// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract WhitelistedVesting is Ownable(msg.sender) {
    IERC20 public primaryToken;
    IERC20 public secondaryToken;

    struct VestingSchedule {
        uint256 totalAllocation;
        uint256 released;
        uint256 startTime;
        uint256 duration;
    }

    mapping(address => VestingSchedule) public vestingSchedules;
    mapping(address => bool) public whitelist;

    event Whitelisted(address indexed user, bool status);
    event TokensPurchased(address indexed user, uint256 amount, uint256 duration);
    event TokensClaimed(address indexed user, uint256 amount);

    constructor(address _primaryToken, address _secondaryToken) {
        primaryToken = IERC20(_primaryToken);
        secondaryToken = IERC20(_secondaryToken);
    }

    modifier onlyWhitelisted() {
        require(whitelist[msg.sender], "Not whitelisted");
        _;
    }

    function addToWhitelist(address _user) external onlyOwner {
        whitelist[_user] = true;
        emit Whitelisted(_user, true);
    }

    function removeFromWhitelist(address _user) external onlyOwner {
        whitelist[_user] = false;
        emit Whitelisted(_user, false);
    }

    function purchaseTokens(uint256 amount, uint256 duration) external onlyWhitelisted {
        require(vestingSchedules[msg.sender].totalAllocation == 0, "Vesting already exists");
        require(duration > 0, "Invalid duration");

        secondaryToken.transferFrom(msg.sender, address(this), amount);

        vestingSchedules[msg.sender] = VestingSchedule({
            totalAllocation: amount,
            released: 0,
            startTime: block.timestamp,
            duration: duration
        });

        emit TokensPurchased(msg.sender, amount, duration);
    }

    function claimTokens() external onlyWhitelisted {
        VestingSchedule storage schedule = vestingSchedules[msg.sender];
        require(schedule.totalAllocation > 0, "No vesting schedule");

        uint256 elapsedTime = block.timestamp - schedule.startTime;
        uint256 vestedAmount = (schedule.totalAllocation * elapsedTime) / schedule.duration;
        uint256 claimable = vestedAmount - schedule.released;

        require(claimable > 0, "No tokens to claim");
        schedule.released += claimable;

        primaryToken.transfer(msg.sender, claimable);
        emit TokensClaimed(msg.sender, claimable);
    }
}

